import {createUser, deleteUsers, fetchUsers, formatGroups, updateUser} from "~/helpers/user";
import {fetchGroups, getGroupFullNames} from '~/helpers/groups';

import {onMounted} from 'vue';
import {FilterMatchMode} from "primevue/api";
import {fetchRoles} from "~/helpers/role";


interface User {
  id?: number;
  first_name?: string;
  middle_name?: string;
  last_name?: string;
  username?: string;
  password?: string;
  email?: string;
  lastLogin?: string;
  avatar?: string;
  about?: string;
  // rolesId?: number;
  role?: {
    id: number;
    code: string;
    name: string;
